/*根据接受到的问题信息列表返回对应的问题显示组件*/

import Text from "../../draftsDisplay/preview/text";
import Location from "../../draftsDisplay/preview/location";

export function quesDisplay(ques) {
	const elements = [];
	for (let que of ques) {
		switch (que.type) {
			case 'text': {
